let update = window.document.querySelector("#btn-submit-facets");

let soundString_bing = "";
let soundString_click = "";
let soundString_tick = "";
let soundString_shake = "";

var snd_bing = new Audio("data:audio/wav;base64," + soundString_bing);
var snd_click = new Audio("data:audio/wav;base64," + soundString_click);
var snd_tick = new Audio("data:audio/wav;base64," + soundString_tick);
var snd_shake = new Audio("data:audio/wav;base64," + soundString_shake);

const array_subjects = ["math", "science", "alt. ed", "geography"];
const array_schools_1 = ["glendale", "sir winston churchill", "bernie custis"];
const array_schools_2 = ["nora henderson", "westdale", "westmount" ,"sherwood"];
const array_schools_3 = ["saltfleet district high", "orchard park secondary"];

setInterval(()=>{
 let anchorText = window.document.querySelectorAll("h4>a");
 let cont= window.document.querySelectorAll("button");
 
 for(let j=0; j < cont.length; j++){if(cont[j].innerText.toLowerCase()=="continue"){cont[j].click()}};
 
 for(let i=0; i < anchorText.length; i++){
      setTimeout(()=>{},200);

      let subject = anchorText[i].innerText.toLowerCase().trim();
      let school = anchorText[i].parentElement.parentElement.children[2].children[0].innerHTML.toLowerCase().trim();
      let load = anchorText[i].parentElement.parentElement.children;
      console.log("LOAD: "+load)

      let bool_subject = array_subjects.includes(subject);
      let bool_school_1 = array_schools_1.includes(school);
      let bool_school_2 = array_schools_2.includes(school);
      let bool_school_3 = array_schools_3.includes(school);
      let bool_load = load.includes("100%");

      let array_bool = [bool_school_1, bool_school_2, bool_school_3];
  
      console.log(subject + " && " + school + " && " + bool_load);
      console.log(bool_subject + " && " + array_bool.some(v=>v==true));
      console.log(" ");
  
      if(subject == "library" && bool_load){
          snd_bing.play()
      }else if(bool_subject && bool_school_1 && bool_load){
          snd_click.play()
      }else if(bool_subject && bool_school_2 && bool_load){
          snd_tick.play()
      }else if(bool_subject && bool_school_3 && bool_load){
          snd_shake.play()
      };
 };
 
 update.click(); 
     
 },10000);
